import React from 'react';
import './todoitem.css';

function TodoItem(props) {
    const {items} = props;
  return (
    <div>
        {items.map((item)=>(
            <table>
                <tr>
                    <td>subject</td>
                    <td>lesson</td>
                </tr>
                <tr>
                    <td>{item.name}</td>
                    <td>{item.age}</td>
                </tr>
            </table>
        ))}
    </div>
  )
}

export default TodoItem
